import React, {Component} from "react";


class Student extends Component{
   constructor(props){
    super(props)
    this.state={
        name:"sahil",
        age:20
    }
   }
 render(){
    return(
        <div>
           <h1>{this.state.name}{this.state.age}</h1> 
        </div>
    );
 };
}
export default Student;
